import React, { Component } from 'react'

class app extends Component {
    render() {
        return (
         <body class="container">
            <header class="page-header">
                <h1>Pi carre Login</h1>
                <a class="btn btn-primary" href="/">Home</a>
            </header>
         </body>
        )
    }
}
export default app;
